@keyframes spin {

  100% {

  display: flex;

.chem-box {
  width: 15%;
  height: 60px;
  background-color: #1293e7;
  border: 1px solid #999;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 15px;
  border: none;
  border-radius: 5px;
  margin-top: 30px;
}

.strikers {
  display: flex;
  justify-content: space-between;
  gap: 30px;
  align-items: center;
  height: 25%;
  padding-left: 100px;
  padding-right: 120px;
}

.lw,
.rw,
.st {
  display: flex;
  flex-direction: column;
  align-items: center;
  position: relative;
  transition: transform 0.3s ease;
}

.midfield {
  display: flex;
  justify-content: space-between;
  align-items: center;
  height: 25%;
  padding: 0 120px;
}

.lcm,
.cm,
.rcm {
  display: flex;
  flex-direction: column;
  align-items: center;
  position: relative;
  transition: transform 0.3s ease;
}

.defense {
  display: flex;
  justify-content: space-between;
  align-items: center;
  height: 25%;
}

.lb,
.lcb,
.rcb,
.rb {
  display: flex;
  flex-direction: column;
  align-items: center;
  position: relative;
  transition: transform 0.3s ease;
}

.keeper {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 25%;
}

.gk {
  display: flex;
  flex-direction: column;
  align-items: center;
  position: relative;
  transition: transform 0.3s ease;
}

.icon {
  font-size: 30px;
  font-weight: bold;
  cursor: pointer;
}
.icon:hover {
  color: #1293e7;
}

.lw:hover,
.rw:hover,
.st:hover,
.lcm:hover,
.cm:hover,
.rcm:hover,
.lb:hover,
.lcb:hover,
.rcb:hover,
.rb:hover,
.gk:hover {
  transform: scale(1.05);
}

.lw .icon,
.rw .icon,
.st .icon,
.lcm .icon,
.cm .icon,
.rcm .icon,
.lb .icon,
.lcb .icon,
.rcb .icon,
.rb .icon,
.gk .icon {
  position: absolute;
  top: 40%;
  left: 50%;
  transform: translate(-50%, -50%);
}

.info_in_team {
  position: absolute;
  top: 35%;
  left: 50%;
  transform: translate(-50%, -50%);
  font-size: 13px;
}

.modal-overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(0, 0, 0, 0.5);
  display: flex;
  justify-content: center;
  align-items: center;
  color: black;
  overflow: auto;
}

.modal-content {
  min-width: 60%;
  max-width: 70%;
  max-height: 50%;
  background: #fff;
  padding: 20px;
  border-radius: 8px;
  overflow-y: auto;
}

.modal-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 20px;
}

.search-bar {
  width: 70%;
  padding: 10px;
  border: 1px solid #ccc;
  border-radius: 4px;
}

.close-button {
  cursor: pointer;
  font-size: 25px;
  transition: transform 0.3s ease;
}
.close-button:hover {
  transform: scale(1.2);
}

.players-container {
  margin-top: 20px;
}
.player-box {
  cursor: pointer;
}

.lw:hover .delete_from_team,
.rw:hover .delete_from_team,
.st:hover .delete_from_team,
.lcm:hover .delete_from_team,
.cm:hover .delete_from_team,
.rcm:hover .delete_from_team,
.lb:hover .delete_from_team,
.lcb:hover .delete_from_team,
.rcb:hover .delete_from_team,
.rb:hover .delete_from_team,
.gk:hover .delete_from_team {
  display: block;
}

.delete_from_team {
  display: none;
  padding: 5px;
  background-color: #ff0000;
  color: #fff;
  border: none;
  border-radius: 4px;
  cursor: pointer;
  position: absolute;
  right: 60px;
  font-size: 30px;
}

.lw .star-container,
.rw .star-container,
.st .star-container,
.lcm .star-container,
.cm .star-container,
.rcm .star-container,
.lb .star-container,
.lcb .star-container,
.rcb .star-container,
.rb .star-container,
.gk .star-container {
  display: flex;
  position: absolute;
  top: 110%;
  left: 110%;
  transform: translate(-100%, -100%);
}

.star-container {
  position: relative;
  left: 70px;
  margin-top: 20px;
}
.star-full {
  color: #45a9dd;
}

  color: white;
  min-height: 60vh;
  padding: 10px;
}

.teams-columns {
  display: flex;
  flex-wrap: wrap;
  flex-direction: column;
}

.single-team {
  width: 80%;
  margin-bottom: 10px;
  background-color: #55cca2;
  color: black;
  font-weight: bold;
  height: 50px;
  display: flex;
  align-items: center;
  padding-left: 10px;
  border-radius: 5px;
  justify-content: space-between;
  transition: color 0.3s;
}
.single-team:hover {
  background-color: #007bff;
  color: #fff;
  /* opacity: 0.7; */
}

.single-team.selected {
  background-color: #007bff;
  color: #fff;
}

.icons {
  display: flex;
  gap: 15px;
  padding-right: 15px;
}

.remove-icon {
  color: black;
  font-size: 22px;
  cursor: pointer;
  transition: color 0.3s, font-size 0.3s;
}
.remove-icon:hover {
  color: red;
  font-size: 24px;
}
.update-icon {
  color: #fbeaea;
  font-size: 22px;
  cursor: pointer;
  transition: color 0.3s, font-size 0.3s;
}
.update-icon:hover {
  opacity: 0.7;
  font-size: 24px;
}

.update-form {
  display: flex;
  align-items: center;
}

.input-update {
  padding: 7px;
  height: 25px;
  border: none;
  outline: none;
  border-radius: 5px;
  margin-right: 10px;
  font-size: 16px;
}

.send-update {
  cursor: pointer;
  color: #fbeaea;
  font-size: 22px;
}

.exit-icon {
  cursor: pointer;
  color: black;
  font-size: 23px;
}

.send-update:hover,
.exit-icon:hover {
  opacity: 0.5;
